import React, { useEffect, useState } from 'react';
import { getMonthlyRevenue, getTrainerPerformance } from '../services/reportService';

const Reports = () => {
    const [revenueData, setRevenueData] = useState([]);
    const [trainerPerformanceData, setTrainerPerformanceData] = useState([]);

    useEffect(() => {
        fetchMonthlyRevenue();
        fetchTrainerPerformance();
    }, []);

    const fetchMonthlyRevenue = async () => {
        try {
            const response = await getMonthlyRevenue();
            setRevenueData(response.data);
        } catch (error) {
            console.error('Error fetching monthly revenue:', error);
        }
    };

    const fetchTrainerPerformance = async () => {
        try {
            const response = await getTrainerPerformance();
            setTrainerPerformanceData(response.data);
        } catch (error) {
            console.error('Error fetching trainer performance:', error);
        }
    };

    return (
        <div className="reports-page">
            <h1>Reports</h1>
            <section>
                <h2>Monthly Revenue</h2>
                <table>
                    <thead>
                        <tr>
                            <th>Month</th>
                            <th>Total Payments</th>
                            <th>Total Revenue</th>
                            <th>Average Payment</th>
                        </tr>
                    </thead>
                    <tbody>
                        {revenueData.map((item, index) => (
                            <tr key={index}>
                                <td>{item.Month}</td>
                                <td>{item.Total_Payments}</td>
                                <td>{item.Total_Revenue}</td>
                                <td>{item.Average_Payment}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </section>
            <section>
                <h2>Trainer Performance</h2>
                <table>
                    <thead>
                        <tr>
                            <th>Trainer Name</th>
                            <th>Total Members</th>
                            <th>Total Sessions</th>
                            <th>Avg Participants Per Session</th>
                            <th>Total Training Hours</th>
                        </tr>
                    </thead>
                    <tbody>
                        {trainerPerformanceData.map((item, index) => (
                            <tr key={index}>
                                <td>{item.Trainer_Name}</td>
                                <td>{item.Total_Members}</td>
                                <td>{item.Total_Sessions}</td>
                                <td>{item.Avg_Participants_Per_Session}</td>
                                <td>{item.Total_Training_Hours}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </section>
        </div>
    );
};

export default Reports;
